import * as React from 'react';
import { StyleSheet } from 'react-native';
import { ProducerTypeEnum, CreateProducerInput } from '../API';
import RegisterProducer from '../components/RegisterProducer'
import EditScreenInfo from '../components/EditScreenInfo';
import ProducerList from '../components/ProducerList'
import { Text, View } from '../components/Themed';
import { SafeAreaView } from 'react-native-safe-area-context';
import { ScrollView } from 'react-native-gesture-handler';
import { widthPercentageToDP } from "react-native-responsive-screen"

const renderedProducer : CreateProducerInput = {
  name: "Bimbo",
  IdType: "NIT",
  personalId:"123456",
  address:"Calle 1 #2-3",
  city:"Medellín",
  producerType:ProducerTypeEnum.Persona_Natural
}

export default function TabOneScreen() {
  return (
      <ScrollView>
        <View style={styles.container}>
          <Text style={styles.title}>Create Producer</Text>
          <View
            style={styles.separator}
            lightColor="#eee"
            darkColor="rgba(255,255,255,0.1)"
          />
          <View style = {styles.subcontainer}>
            <RegisterProducer path="/screens/TabOneScreen.tsx" />
            <RegisterProducer path="/screens/TabOneScreen.tsx" />
          </View>
          <View style= {styles.subcontainer}>
            <ProducerList />
          </View>

        </View>
      </ScrollView>

  );
}

const styles = StyleSheet.create({
  container: {
    alignItems: 'center',
    justifyContent: 'center',
    maxWidth: widthPercentageToDP('100%')
  },
  title: {
    fontSize: 20,
    fontWeight: 'bold',
  },
  separator: {
    marginVertical: 30,
    height: 1,
    width: '90%',
    flexDirection:'row',
  },
  subcontainer: {
    display: 'flex',
    flexDirection: 'row',
    flexWrap:'wrap'
  },
});
